import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import React, { useState } from 'react';
import Toast from 'react-hot-toast';
import { Container } from 'react-bootstrap';
function Login() {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    function getCookie(key) {
        var b = document.cookie.match("(^|;)\\s*" + key + "\\s*=\\s*([^;]+)");
        return b ? b.pop() : "";
    }

    function reset_form(event) {
        try {
            event.stopPropagation();
            setEmail('');
            setPassword('');
        } catch (error) {

        }
    }

    function error_mensaje(titulo_mensaje){
        Toast.error(
           titulo_mensaje,
            {
                duration: 2000,
            }
        );
    }

    const onButtonClick = (event) => {
        try {
            event.preventDefault();


            if ('' === email) {
                error_mensaje('Porfavor, escribi tu email')
                return
            }

            if (!/^[\w-.]+@([\w-]+\.)+[\w-]{2,4}$/.test(email)) {
                error_mensaje('Porfavor escribi un email valido')
                return
            }

            if ('' === password) {
                error_mensaje('Porfavor escribi una contraseña')
                return
            }

            if (password.length < 4) {
                error_mensaje('La contraseña tiene que tener mas de 4 caracteres')
                return
            }
            Buscar_data();

        } catch (error) {
            Toast.error(
                'Ocurrio un error',
                {
                    duration: 2000,
                }
            );
        }
    }


    function recibir_respuesta(e) {
        try {
            let obj = e.find(o => o.email === email && o.password === password);
            if (obj !== null) {
                localStorage.setItem('nombre', obj.nombre);
                localStorage.setItem('privilegio', obj.privilegio);
                Toast.success(
                    'Bienvenido: ' + obj.nombre,
                    {
                        duration: 2000,
                    }
                );
                setTimeout(() => {
                    window.location = 'http://localhost:3000/';
                }, 2500);

            } else {
                error_mensaje('Email o contraseña incorrecto')
            }
        } catch (error) {
            error_mensaje('Email o contraseña incorrecto')
        }
    }

    async function Buscar_data() {
        try {
            const response = await fetch('http://localhost:4000/usuarios');
            if (response.ok) {
                response.json().then(e => recibir_respuesta(e))
            } else {
                error_mensaje('Ocurrio un error');
            }
        } catch (error) {
            error_mensaje('Ocurrio un error');
        }
    }

    if (localStorage.getItem('privilegio') == null || localStorage.getItem('privilegio').length === 0) {
        if (getCookie('error') === 'true') {
            Toast.error(
                'No tenes permisos para acceder',
                {
                    duration: 2000,
                }
            );
            document.cookie = "error=; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/;";
        }
        return (
            <Container className='card'>
                <div className='card-header'>
                    <h2 className="ml-3 text-center text-green" > Iniciar session </h2>
                </div>
                <Form className='login-form'>
                    <Form.Group className="mb-3" controlId="formBasicEmail">
                        <Form.Label>Direccion de E-mail</Form.Label>
                        <Form.Control type="email" value={email} placeholder="Ingresa tu e-mail" onChange={(ev) => setEmail(ev.target.value)} />
                        <Form.Text className="text-muted">
                            Nunca vamos a compartir tu e-mail con nadie
                        </Form.Text>

                    </Form.Group>

                    <Form.Group className="mb-3" controlId="formBasicPassword">
                        <Form.Label>Contraseña</Form.Label>
                        <Form.Control value={password} type="password" placeholder="Contraseña" onChange={(ev) => setPassword(ev.target.value)} />

                    </Form.Group>

                    <div className='card-footer'>
                        <Button onClick={event => onButtonClick(event)} variant="primary" type="submit">
                            Enviar
                        </Button>
                        <Button className='margin_left_085rem' onClick={event => reset_form(event)} variant="danger" type="reset">
                            Limpiar
                        </Button>
                    </div>
                </Form>
            </Container>
        );
    } else {
        window.location = 'http://localhost:3000/Libros';
    }
}

export default Login;
